import React, { useState, useEffect } from "react";
import "./Electronics.css";
import CategoriesNav from "../categoriesNav/categoriesNav";

const Electronics = () => {
  const [data, setData] = useState([]); 
  const [loading, setLoading] = useState(true); 
  const [error, setError] = useState(null);

 
  const fetchData = async () => {
    try {
      const response = await fetch("https://api.example.com/Electronics"); 
      if (!response.ok) {
        throw new Error("Failed to fetch data");
      }
      const result = await response.json();
      setData(result); 
    } catch (err) {
      setError(err.message); 
    } finally {
      setLoading(false); 
    }
  };

  useEffect(() => {
    fetchData(); 
  }, []);

  return (
    <div className="Electronics">
      <CategoriesNav/>
      <h2 className="Electronics-title">Available Electronics</h2>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>} 

      <div className="Electronics-container">
        {data.map((electronics) => (
          <div key={electronics.id} className="Electronics-card">
            <img src={electronics.image} alt={electronics.name} className="Electronics-image" />
            <div className="Electronics-content">
              <h3 className="Electronics-name">{electronics.name}</h3>
              <p className="Electronics-description">{electronics.description}</p>
              <p className="Electronics-price">Price: {electronics.price}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Electronics;
